import React,{Component} from "react";
import { isAuthenticated, login, logout } from "../../services/auth";
import "./styles.css";

export default class Main extends Component{

    state = {
        loggedIn: ""
    };

    doLogout = () => {
        logout();
    }

    render(){

        if(isAuthenticated()){
            return(
                <header >
                    <div className="main-header">Light My Mind</div>
                <div className="actions">
                    <button onClick={this.doLogout}>Sair</button>
                    </div>
                </header>
            );
        }
        else{
            return(
                <header >
                    <div className="main-header">Light My Mind</div>
                </header>
            );
        }
    }
}
